●大自工業（メルテック）のAC100V用電動インパクトレンチのFT-50P<br>●エアーインパクトと同じ動きでスムーズにナットが回り、作業が楽々・強力・時短！<br><br>【仕様】<br>■入力電圧：AC100V<br>■使用電流：単相交流 50/60Hz<br>■締付トルク：250N・m 締付時間2秒(継ぎコードなしの場合)<br>■能力：ボルトサイズM10～M14(普通ボルト)<br>■アンビル部寸法：12.7mm(ソケット取付部の四角の対辺寸法)<br>■電流：3.5A<br>■消費電力：定格350W<br>■回転数：0～2900min-1<br>■打撃数：0～3100min-1<br>■付属品：ディープソケット(19mm・21mm)<br>■電源コードの長さ：約2.1m<br>■本体サイズ / 重量 約80(W)×205(H)×290(D)mm / 約2.1kg(コード・ソケット除く)<br>■パッケージサイズ：約380(W)×295(H)×101(D)mm<style type="text/css">
